// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Banc {

mapping(address => uint) public balance;
mapping(address => uint) public time;
uint public stepTime = 0.05 hours;
uint percentDeposit = 12;
address payable wallet;
uint percentCredit = 15;

event Invest(address investor, uint256 amount);
event Withdraw(address investor, uint256 amount);

modifier userExist() {
  require(balance[msg.sender] > 0, "Client not exist");
  _;
}

modifier checkTime() {
  require(block.timestamp>= time[msg.sender]+stepTime, "Veri short period of time");
  _;
}

function bankAccount() public payable {
  require(msg.value >= 0.01 ether);
}

function setPercentDeposit(uint _percentDeposit) public {
  percentDeposit = _percentDeposit;
}

function getPercentRate() public view returns(uint) {
  return percentDeposit;
}

function deposit() public payable {
  if (msg.value > 0) {
        balance[msg.sender] = balance[msg.sender]+msg.value;
    time[msg.sender] = block.timestamp;
    emit Invest(msg.sender, msg.value);
  }
}

function payoutAmount() public view returns(uint256) {
  uint rate = balance[msg.sender]*percentDeposit/100;
  return rate;
}

function returnDeposit() public payable {
  uint withdrawallAmount = balance[msg.sender];
  balance[msg.sender] = 0;
  time[msg.sender] = 0;
  msg.sender.transfer(withdrawallAmount);
}


function collectPercent() userExist checkTime public {
  uint payout = payoutAmount();
  msg.sender.transfer(payout);
  emit Withdraw(msg.sender, payout); 
}
}
